// Contact.jsx
import React from 'react';
import '../assets/styles/App.css';
import sigilism from '../assets/imgs/sigilism-contact.png';

const Contact = () => {
  return (
    <div className="content">
      <img src={sigilism} alt="" style={{ zIndex: '10', position: 'absolute', left: '10%' , width: '25%' , height: '50%' }} />
      <h1 style={{ color: '#e96f7c', textAlign: 'center' }}>
        - Contact -
        <br />
        In maintenance
      </h1>
    </div>
  );
};

export default Contact;
